import React from "react";
import { Container } from "react-bootstrap";
import "../side/side.css";

const Side = () => {
  return (
    <sidenav>
      <div className="container-fluid">
        <div className="colum">
        <h1 className="font-weight-bold">
          Arab <span>Lionz</span>
        </h1>
        <div className="all">
          <ul className="types">
            <li className="films">Films</li>
            <li className="seires">seires</li>
          </ul>
        </div>
      </div>
      </div>
    </sidenav>
  );
};
export default Side;
